import useState from 'react';

function Counter(props) {

    const [count, setCount] = useState(props.num);

    return (
        <div>
            <h2>Bug Log Counter</h2>
            <p>Current count:</p>
            <button>Increment</button>
        </div>
    );
}

export default Counter;
